     &       UChaC(Cha4,2))/(CB2*SB2)

        Sub588(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &       Sub541(All5,Cha4,Ind1)*Sub565(All4,Cha4,Ind2)*
     &       Sub578(All4,All5,Ind3,Ind4) + 
     &      2*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &       Mf(bH,gno2)*Sub573(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &       UChaC(Cha4,2))/(CB2*SB2)

        Sub579(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &       Sub541(All5,Cha4,Ind1)*Sub565(All4,Cha4,Ind2)*
     &       Sub578(All4,All5,Ind3,Ind4) + 
     &      2*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &       Mf(bH,gno2)*Sub573(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &       UChaC(Cha4,2))/(CB2*SB2)

        Sub590(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &       Sub541(All5,Cha4,Ind1)*Sub565(All4,Cha4,Ind2)*
     &       Sub584(All4,All5,Ind3,Ind4) + 
     &      2*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &       Mf(bH,gno2)*Sub581(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &       UChaC(Cha4,2))/(CB2*SB2)

        Sub585(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &       Sub541(All5,Cha4,Ind1)*Sub565(All4,Cha4,Ind2)*
     &       Sub584(All4,All5,Ind3,Ind4) + 
     &      2*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &       Mf(bH,gno2)*Sub581(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &       UChaC(Cha4,2))/(CB2*SB2)

        Sub580(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub566(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub579(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub589(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub587(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub588(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub586(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (-(3*cI*(CW*SB*Sub585(All4,All5,Cha4,Ind1,Ind2,
     &            Ind3,Ind4)*XHiggs(hno,3,uzext1))) + 
     &      TB*Sub580(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4))/
     &    (CW*SB*TB)

        Sub591(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (-(3*cI*(CW*SB*Sub590(All4,All5,Cha4,Ind1,Ind2,
     &            Ind3,Ind4)*XHiggs(hno,3,uzext1))) + 
     &      TB*Sub589(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4))/
     &    (CW*SB*TB)

        Sub592(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   m3*pave16(PVC(cc2),All4,All5,Cha4)*
     &     Sub586(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &    m2*pave16(PVC(cc1),All4,All5,Cha4)*
     &     Sub591(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)

	ENDLOOP(All4)
	ENDLOOP(All5)
	ENDLOOP(Cha4)
	ENDLOOP(Ind1)
	ENDLOOP(Ind2)
	ENDLOOP(Ind3)
	ENDLOOP(Ind4)

	end
